def is_prime(n): return n > 1 and all(n % i != 0 for i in range(2, int(n**0.5) + 1))

fib = [0, 1]
while len(fib) < 20:
    fib.append(fib[-1] + fib[-2])

fib_primes = [num for num in fib if is_prime(num)]
print(fib_primes)
